package com.home.commonBase.table.result;
import com.home.shine.table.BaseDBResult;

/** 激活码表(generated by shine) */
public class ActivationCodeDBResult extends BaseDBResult
{
	/** 码 */
	public String code="";
	
	/** id */
	public int id;
	
	/** 剩余可使用次数 */
	public int lastNum;
	
	/** 生成时间戳 */
	public long bornTime;
	
	/** 失效时间戳 */
	public long disableTime;
	
	@Override
	protected void toReadValues()
	{
		code=readString();
		id=readInt();
		lastNum=readInt();
		bornTime=readLong();
		disableTime=readLong();
	}
	
	@Override
	public Object getPrimaryKeyByIndex(int index)
	{
		switch(index)
		{
			case 0:
				return code;
		}
		
		return null;
	}
	
}
